INSERT INTO `django_flatpage` VALUES (1,'/Activities.html','Activities','<p>Swinging activities can include (but are not limited to):</p>\r\n<ul>\r\n<li><b>Exhibitionism</b>: having sex with a partner while being watched.</li>\r\n<li><b>Voyeurism</b>: watching others have sex (perhaps with the above mentioned partner).</li>\r\n<li><b>Soft Swinging</b> or <b>Soft Swap</b>: kissing, stroking, or having oral sex with a third or fourth person. This may be in the form of a threesome or group sex, or partners may literally be swapped.</li>\r\n<li><b>Full Swap</b>: having penetrative sex with someone other than one\'s partner, which is the commonly understood definition of swinging (though not necessarily the most common type).</li>\r\n<li><b>Group Sex</b>: An all inclusive term for activities involving multiple partners in the same vicinity.</li>\r\n</ul>\r\n<p>Typically, swinging activities occur when a married or otherwise committed couple engages with either another couple, multiple couples, or a single individual. These acts can occur in the same room (often called <b>same room</b> swinging) though <b>different</b> or <b>separate room</b> swinging does occur. Sex on these occasions is often referred to as <b>play</b>.</p>\r\n<p>While the vast majority of <b>swingers</b> are heterosexual couples, a major part of <b>Lifestyle</b> activities are bisexual in nature. A large portion of female swingers, while they may or may not identify as bisexual, are interested in female-female sexual contact. Male-male contact is very rare, and usually never allowed in at a Swing Club/Party.',0,'',0),(3,'/History.html','History','<p>Historically, it has not been uncommon to find societies that have advocated having multiple sexual partners. Furthermore both royalty and nobility in many cultures had consorts and concubines. Ancient Rome has been notable (if not infamous) for its enthusiastic acceptance of orgies and alternative sexual practices. However, though contemporary swingers celebrate those ideals, the actual practice of swinging in the 20th century began differently.</p>\r\n<p>According to Terry Gould\'s <i>The Lifestyle: A Look at the Erotic Rites of Swingers</i> (ISBN 1-55209-482-0), swinging began among U.S. Air Force pilots and their wives during World War II. In this small community, the mortality rate among pilots was significantly high. Gould reports that a close bond between pilots arose, with the implication that the husbands would protect and care for all the wives as their own, both emotionally and sexually, if the husbands were away or lost.</p>\r\n<p>This historical narrative is debatable, however, since it would have been highly unusual for servicemen\'s wives to accompany them on any foreign tours of duty. Other sources point to American Air Force pilots stationed in the California desert as the original participants in modern swinging. Though the exact beginnings are not agreed upon, it is widely assumed that swinging began amongst American military communities in the 1950s.</p>\r\n<p>By the time the Korean War ended, these groups had spread from the bases to the nearby suburbs. The media picked up on them in 1957 and promptly dubbed the phenomenon \"wife-swapping.\"</p>\r\n<p>It wasn\'t until the 1960s in Berkeley, California that the first organization, \"Sexual Freedom League\", for swingers was opened. Ultimately, an umbrella organization called the North American Swing Club Association (NASCA) (now NASCA International) was formed to encourage accurate information about swinging lifestyles all across America.</p>',0,'',0),(4,'/Research.html','Research','<p>Some subjective scientific research into swinging has been conducted in the USA since the late 1960s. The most recent study, based on an Internet questionnaire addressed to visitors of lifestyle-related sites, found swingers are happier in their relationships than the norm. </p>\r\n<ul>\r\n<li>60% of swingers said that swinging improved their relationship and only 1.7% said it made their relationship less happy. Half of those who rated their relationship very happy before becoming swingers maintained it had become even happier.</li>\r\n<li>90% of those with less happy relationships said swinging improved them.</li>\r\n<li>Almost 70% of swingers claimed no problem with controlling jealousy, around a quarter admitted \"I have difficulty controlling jealousy when swinging\" to be somewhat true but only 6% said this was \"Yes, Very Much\" true.</li>\r\n<li>Swingers rate themselves happier (59% against 32% very happy) and their lives much more exciting (76% against 54% exciting) than does the rest of the population, by surprisingly large margins.</li>\r\n</ul>\r\n<p>There was no difference between the responses of men and women, although more males (70%) than females completed the survey.</p>\r\n<p>This study, while enlightening, is of limited accuracy of the swinging population as a whole, due to its self-selected sampling technique. Internet-based sampling procedures create a substantial potential for bias. It is likely that those swinging couples who had stronger relationships were more motivated to complete the questionnaire. Alternatively, the stress that swinging may place on a marriage means that only those with higher than average levels of commitment to their partners are able to remain married whilst swinging. Couples that have jealousy or strife issues caused by swinging will not usually stay in the swinging lifestyle and thus would have been unlikely to respond.</p>\r\n<p>ABC News reporter John Stossel produced an investigative report into the lifestyle. Stossel reported that over 4 million people are swingers, according to estimates by the Kinsey Institute and other researchers. He also cited Terry Gould\'s research, in which Gould concluded that \"couples swing in order to <i>not</i> cheat on their partners.\" When Stossel asked swinging couples whether they worry that their spouse will \"find they like someone else better\", one male interviewee replied, \"People in the swinging community swing for a reason. They don\'t swing to go out and find a new wife;\" while a woman interviewee asserted, \"It makes women more confident -- that they are the ones in charge.\" Stossel interviewed 12 marriage counselors about the lifestyle. According to Stossel, \"not one of them said don\'t do it\", though some also said \"getting sexual thrills outside of marriage can threaten a marriage\". Nevertheless, the swingers whom Stossel interviewed claimed that \"their marriages are stronger because they don\'t have affairs and they don\'t lie to each other.\"</p>',0,'',0),(5,'/Organizations.html','Organizations','<p>Certain <b>Lifestyle</b> activities are highly organized. There are over 3,000 swinging clubs worldwide. Most major cities in North America and western Europe have at least one <b>swingers\' club</b> in a permanent location although they often keep a low profile to avoid negative attention. Swingers also meet through lifestyle magazines, personal ads, swinging house parties, and Internet sites.</p>\r\n<p>Clubs can refer to a physical location or building. In this context, clubs are typically divided into \"on-premise\" clubs, where sexual activity may happen then and there at the club, and \"off-premise\" clubs where sexual activity is not allowed at the club, but may be arranged at a near-by location. \"Clubs\" also may refer to the group that organizes the Lifestyle-related events in a particular area.</p>\r\n<p>In the USA, many swinging clubs follow a bar or nightclub format, sometimes renting an entire existing bar for scheduled events, frequently termed a venue <b>takeover</b>. This is normally done to avoid interaction with non-Lifestyle segments of the population, and once again to avoid unwanted negative attention. This often relegates these activities to suburbia on the weekend, where bars in large industrial parks which attract a mainstream clientele during weekdays would otherwise sit empty or closed on weekends when offices shut down. On-premise clubs usually have a similar format. One notable exception to this is that most on-premise clubs do not serve alcohol, asking participants instead to bring their own because of the restrictive laws commonly in place regarding sexual activity and the presence of alcoholic beverages. Concordantly, the vast majority of swinging clubs do not advertise as such due to the strict moral climate in the United States. Another format is the swinger party. Usually in a home where parking may require a shuttle from another location if the home resides within a suburban area. A home that is usually suitable may have a hot tub, a pool, several bedrooms, and an assortment of sex furniture such as a sex swing, a stripper pole, a dance floor, or a BDSM dungeon. Within the party atmosphere condoms, lube and breath mints may be readily available throughout the house. Sometimes the host may hold events such as a striptease or dance contest, a flogging or other BDSM demonstration.</p>\r\n<p>In Europe off-premises clubs are rare and the majority of swinging venues allow sexual contact and serve alcohol. There are three standard formats: the bar/nightclub, usually smaller, in city centres and focused around a dance floor; the spa format which has pools, Jacuzzis, saunas and steam rooms and where people strip on entry; and the country club format, which is out-of-town, usually serves a free buffet and may include elements of the first two as well as offering large play spaces.</p>\r\n<p>A large amount of swinging activity is organised via the Internet, where there are countless different sites with personals, listings and local information. To many couples, the swinging lifestyle and the clubs can be as much a social venue as a sexual one. Like many sexual sub-cultures, there can be very much a community atmosphere, and the greater communication allowed by the Internet has fostered this sense.</p>',0,'',0),(6,'/Etiquette.html','Etiquette','<p>The \'prime directive\' in swinging is \"no means no\". This means that rejection of a sexual advance does not require justification and must always be respected. Respect for one\'s play partners is often a hallmark of swinging activity, and violation of this directive can result in immediate expulsion. Concordantly, in the US it is often regarded as impolite to touch without asking, whereas in the UK and Europe both touching and gently but firmly removing a touching hand are widely regarded as polite non-verbal communication in the playroom context.</p>\r\n<p>Many swingers who participate in penetrative sex whilst swinging are strict about condom usage, including insisting on changing condoms between partners. However, some members of the swinging community do engage in unprotected sex, in a practice that is commonly known as barebacking. When unsure, it is considered a polite necessity to establish these ground rules before becoming sexually involved.</p>\r\n<p>Some swingers believe that it\'s possible to spot others in the same way that Gaydar is supposed to work (sometimes referred to as <i>Playdar</i>), while others may rely on more overt signs. Among homosexual communities, a traditional means to identify one another was a single earring in the right ear; however, currently, there is no commonly used method for identifying swingers. Some believe that actions such as a woman being flirtatious while their significant other is present, men who offer their wives to dance or couples entering a bar separately and spending the evening apart are ways to tell if a couple swings. Obviously, these signs, both subtle and overt, are difficult to perceive, and swingers are often averse to identifying themselves in public. The growth of many swinging web sites on the Internet is partly due to this, allowing swingers to communicate and meet without public attention or the risk of offending non-swingers.</p>',0,'',0),(7,'/Bisexuality.html','Bisexuality','<p>Female bisexuality and bicuriousity is common in both the urban and traditional swinging scene and tends to be the norm amongst participants. No studies have been conducted as to what percentage of swinging women who define themselves as bisexual would be open to romantic as well as sexual relations with both genders.</p>\r\n<p>Male bisexuality is less common in the swinging scene. More openly bi men and bisexual couples (male-female couples where both partners are bisexual) are appearing on the scene. Whether this is due to increasing acceptance in the scene or greater numbers of men \"turning bi\" is open to discussion. Depending on the club or social situation male bisexuality among swingers may either be frowned upon, or openly accepted.</p>',0,'',0),(8,'/Dogging.html','Dogging','Dogging is a British term for swinging based in cars that takes place in a public but reasonably secluded area. There are several known dogging spots across the UK where people go after dark, typically to engage in voyeurism and exhibitionism but also to take part in group sex.',0,'',0),(9,'/Hot-Wife.html','Hot Wife. Cuckold','<p>The term <b>hot wife</b> refers to a married woman who has sex with men other than her spouse, with the husband\'s consent. In most cases the husbands take a vicarious pleasure in their wives enjoyment, or enjoy watching, hearing, or knowing about their wives\' adventures. (See: Compersion). Husbands may also take part by engaging in threesomes, or arranging dates for their wives.</p>\r\n<p>A distinct subculture of <strike>hotwiving</strike> hotwifing   is cuckolding. This subculture is generally defined as a subgenre in which emphasis is placed upon the sexual humiliation of role reversal, with the woman free to flaunt her sexuality and show blatent enjoyment, and the husband restricted to a passive or subordinated role, possibly involving erotic sexual denial.</p>',0,'',0),(10,'/Polyamory.html','Polyamory','<p>Polyamory is a term that contrasts with monogamy, for the notion that long term full and intimate relationships need not be sexually or emotionally exclusive. So-called poly lifestyles vary, with some being open relationships and others less so.</p>\r\n<p>There is not necessarily a great degree of overlap between swinging and polyamory communities, as they are different outlooks. In swinging the forming of deeper emotional relationships are not the norm and are considered a rarity.</p>',0,'',0),(11,'/Selective-swinging.html','Selective swinging','<p>Traditionally swinger clubs are accepting of all ages and body types, and the average age of swingers at events tends to be around 45. Younger swingers who wish to swing with their own age group find that this isn\'t always possible in swinging clubs.</p>\r\n<p>Fever Parties began running parties for affluent under 40s in London in the late 1990s. Other party organisers, such as Lounge Parties in London (who select on looks, but not age) and Belle Baise in the Midlands (who select on looks and age) have sprung up in recent years. These organisations try to elevate themselves from historic swinging clubs by hosting their events in upmarket venues, serving Champagne or cocktails and asking their guests to dress in smart evening attire. Entry to these parties is often competitive and photographs are usually required to demonstrate attractiveness.</p>\r\n<p>Due to the success of these events in the UK, they have subsequently spread to Norway, South Africa, Sweden and the USA. This, more than anything else, has given rise to the term <b>The Lifestyle</b> as a way to encompass all swinging activities, due to the fact that younger couples are somewhat averse to the term \"swingers\" because of its traditional connotations.</p>\r\n<p>\'Selective swinging\' events include mostly childless, unmarried young graduates and can have average ages as low as the late 20s, whereas traditional swingers events tend to have average ages in the 40s. Selective parties are often referred to as \"exclusive\" or \"elitist\".  Contravening the usual assumption that such organisations are not associated with groups propagating \"family values\", the Fever parties were revealed in June 2003 to be organised by a senior co-ordinator of a British Conservative Party pressure group, Conservatives for Change, who was older than the maximum age allowed to attend his events.</p>\r\n<p>Another factor contributing to this situation is the continued upsurge in growth of Lifestyle-oriented Internet sites. These sites provide much more accessible gateways into Lifestyle activities for people who are curious about swinging. By offering greater flexibility when searching for potential playmates, it becomes possible to look for playmates that specifically match certain characteristics, including location, looks, wealth, and age. In the United States, it is still uncommon to find parties where stringent age requirements are in affect, and most groups remain non-discriminatory. However, the acceptance of \'elite\' parties continues to be more common, with couples and single females becoming more and more willing to pay an additional premium to spend time with only a select segment of the swinging population.</p>\r\n<p>The critique of selective swinging among traditional swingers is that it is unethical to discriminate. The growing upsurge interest in selective swinging has given rise to a growing rift between the two groups. Couples who identify with traditional swinging may advertise themselves as \"not Ken and Barbie\" as an implicit rejection of what they perceive to be a superficial ideal of youthful physical attractiveness. The proponents of selective swinging claim an entitlement to peer-group options in this as in other leisure pursuits. A large effort among members of the Lifestyle as a whole is being made to unify the two sub-groups, because arguments between the two are seen as divisive and destructive to the community as a whole.</p>',0,'',0),(12,'/Singles.html','Singles','<p>The acceptance of singles at swinging events varies from geographic area to geographic area and event to event. Some swinging \"clubs\" have a policy of allowing only couples and females, but most do allow single men on selected nights. Single females are often admitted at reduced admission price. Parties and private events may differ, however, and are often restricted to couples or couples and single females only.</p>\r\n<p>The reasons for this vary. Most (but certainly not all) of the people who pay to participate in swinger events are male-female couples and most swinging couples are more interested in interacting with other couples or with single women than with single men. Thus, swinger events strive to achieve a balance between male and female participants or have a (usually slightly) larger number of females than males.</p>\r\n<p>A common complaint among swingers is that single men change the tone and nature of event. While outright hostility towards single men is rarely prevalent, an abundance of single males is rarely looked upon favourably in any swinging context. When single males are permitted their numbers are usually limited by high entrance fees or stringent membership requirements.</p>\r\n<p>In the UK, swinging nights which are designed for catering to women who want multiple men are referred to as <i>Greedy Girls\' Nights</i> and they are, to all intents and purposes gang bangs. They are often held in swingers\' clubs (on less busy nights) or take place as private parties. These are attended by both couples and singles, a proportion of which are sometimes prostitutes.</p>\r\n<p>Some swingers oppose the involvement of any singles of either sex in swinging because of the fear that they might split existing couples. While this might be a fear of some new couples, couples who have been part of the \"Lifestyle\" for some time report that the only way a couple can \"split\" is when one of the couple is looking outside the primary relati